  function setupCodeCopy() {
    $('.code-copy-container').each(function() {
      var text = $(this).next('.code-text-only').html();
      text = text.replace(/&amp;/g, '&').replace(/&lt;/g, '<').replace(/&gt;/g, '>');
      var clip = new ZeroClipboard.Client();
      clip.setHandCursor(true);
      clip.setText(text);

      var $html = $(clip.getHTML(63, 14));
      $html.append('<div class="here">here</div>');
      $(this).find('.zero-clipboard').html($html);

      //$(this).find('.zero-clipboard').html(clip.getHTML(63, 14));
      $('.code-copy-container').css("position", "absolute");
      setTimeout(function() {
        if (clip.ready) {
          $('.code-copy-container').css("visibility", "visible").css("position", "absolute");
        }
      }, 1500);


      var $link = $(this).find('.code-copy-button');

      clip.addEventListener('mouseDown', function(client) {
        $link.text('Copying...');
      });

      clip.addEventListener('mouseOver', function(client) {
        $link.css("color", "#005580");
      });

      clip.addEventListener('mouseOut', function(client) {
        $link.css("color", "#08c");
      });

      clip.addEventListener('complete', function(client, text) {
        $link.text('Copied!');
        setTimeout(function() {
          $link.text("Copy Code");
        }, 1200);
      });
    });
  }

